import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the search input by placeholder (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' in the search input
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Take screenshot after typing
    const afterTypingShot = path.join(screenshotsDir, 'step_2_after_typing.png');
    await page.screenshot({ path: afterTypingShot });
    screenshots.push(afterTypingShot);

    // Wait for the search button using nth-of-type (since there are multiple .search-btn)
    // We'll use the first visible .search-btn after the input
    const searchBtn = await page.$('input[placeholder="Search Amazon"] + .search-btn');
    if (searchBtn) {
      await searchBtn.click();
    } else {
      // Fallback: click the first visible .search-btn
      const btns = await page.$$('.search-btn');
      let clicked = false;
      for (const btn of btns) {
        if (await btn.isVisible()) {
          await btn.click();
          clicked = true;
          break;
        }
      }
      if (!clicked) throw new Error('No visible search button found');
    }

    // Wait for the search results heading (text-based selector)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    const resultsShot = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: resultsShot });
    screenshots.push(resultsShot);

    // Extract product titles containing 'iPhone' from the results
    // Use text selector for product cards
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes
        .filter(node => node.textContent && node.textContent.toLowerCase().includes('iphone'))
        .map(node => node.textContent.trim())
    );

    return {
      success: true,
      action: "Searched for 'iPhone' and extracted matching product titles from results",
      extractedData: {
        foundTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
